f.hM("Beauty and Health","\u0627\u0644\u062c\u0645\u0627\u0644 \u0648\u0627\u0644\u0635\u062d\u0629",A.a(["Hair and personal care, vitamins-dietary supplements and sports nutrition products are not eligible for return.","Beauty (Cosmetics, Skin Care, etc.), fragrances and Health products that are opened or used will not be accepted."],s),A.a(["\u0644\u0627 \u064a\u0633\u0645\u062d \u0628\u0627\u0633\u062a\u0631\u062c\u0627\u0639 \u0645\u0646\u062a\u062c\u0627\u062a \u0627\u0644\u0634\u0639\u0631 \u0648\u0627\u0644\u0639\u0646\u0627\u064a\u0629 \u0627\u0644\u0634\u062e\u0635\u064a\u0629 \u0648\u0627\u0644\u0641\u064a\u062a\u0627\u0645\u064a\u0646\u0627\u062a \u0648\u0627\u0644\u0645\u0643\u0645\u0644\u0627\u062a \u0627\u0644\u063a\u0630\u0627\u0626\u064a\u0629 \u0648\u0627\u0644\u0645\u0646\u062a\u062c\u0627\u062a \u0627\u0644\u063a\u0630\u0627\u0626\u064a\u0629 \u0627\u0644\u0631\u064a\u0627\u0636\u064a\u0629.","\u0644\u0627 \u062a\u064f\u0642\u0628\u0644 \u0645\u0646\u062a\u062c\u0627\u062a \u0627\u0644\u062c\u0645\u0627\u0644 (\u0645\u0633\u062a\u062d\u0636\u0631\u0627\u062a \u0627\u0644\u062a\u062c\u0645\u064a\u0644\u060c \u0648\u0627\u0644\u0639\u0646\u0627\u064a\u0629 \u0628\u0627\u0644\u0628\u0634\u0631\u0629\u060c \u0648\u0645\u0627 \u0625\u0644\u0649 \u0630\u0644\u0643) \u0648\u0627\u0644\u0639\u0637\u0648\u0631\u060c \u0648\u0627\u0644\u0645\u0646\u062a\u062c\u0627\u062a \u0627\u0644\u0635\u062d\u064a\u0629 \u0627\u0644\u062a\u064a \u0641\u062a\u062d\u062a \u0623\u0648 \u0627\u0633\u062a\u062e\u062f\u0645\u062a."],s),3,1)
